
function generateView(doc) {

	//first page:
	gen_OrderOfWorship(doc);
	gen_Welcome(doc);
	gen_SermonSection(doc);

	doc.addPage();

	gen_StaticComponents(doc);
	gen_Date(doc);
	gen_Announcements(doc);
	gen_Ministries(doc);

	//gen_OtherStuffs(doc);

	$("#preview").attr("src", doc.output('datauristring'));
}


convSS = (str)=>{
	var s = str;
	s = s.split('0').join('⁰');
	s = s.split('1').join('¹');
	s = s.split('2').join('²');
	s = s.split('3').join('³');
	s = s.split('4').join('⁴');
	s = s.split('5').join('⁵');
	s = s.split('6').join('⁶');
	s = s.split('7').join('⁷');
	s = s.split('8').join('⁸');
	s = s.split('9').join('⁹');
	return s;
}



//=============================================================================
// Order of Worship
//=============================================================================
function gen_OrderOfWorship(doc) {

	//doc.setFont("futur", "futura", "normal");

	var ctr = 0.9;
	var hasCommunion = $('#showCommunion').is(':checked');

	function inc(h) {
		ctr += (h || 0.28);
		return ctr;
	}

	//title
	doc.setFontSize(17);
	doc.text(2.75, 0.5, 'ORDER OF WORSHIP', null, null, 'center');

	doc.setFontSize(8.5);
	doc.setFontType('italic');
	doc.text(2.75, 0.65, dl.date['fd'], null, null, 'center');


	//left side
	ctr = 0.8;
	doc.setFontSize(11);
	doc.setFontType('normal');
	doc.text(0.3, inc(), 'Welcome');
	doc.text(0.3, inc(), 'Singing God\'s Praises');
	if(hasCommunion)
		doc.text(0.3, inc(), 'Holy Communion');
	doc.text(0.3, inc(), 'Prayer & Giving Back to God*');
	doc.text(0.3, inc(), 'Announcements');
	doc.text(0.3, inc(), 'Sermon');
	doc.text(0.3, inc(0.7), 'Song of Response');
	doc.text(0.3, inc(), 'Benediction');

	//right side
	ctr = 0.8;
	doc.setFontType('italic');
	doc.text(5.2, inc(), dl.gV('welcomeName'), null, null, 'right');
	doc.text(5.2, inc(), convSS(dl.gV('worshipTeam')), null, null, 'right');
	if(hasCommunion)
		doc.text(5.2, inc(), dl.gV('pastor'), null, null, 'right');
	doc.text(5.2, inc(), dl.gV('presider'), null, null, 'right');
	doc.text(5.2, inc(), dl.gV('presider'), null, null, 'right');
	doc.text(5.2, inc(), dl.gV('pastor'), null, null, 'right');
	doc.text(5.2, inc(0.7), dl.gV('worshipTeam'), null, null, 'right');
	doc.text(5.2, inc(), dl.gV('pastor'), null, null, 'right');


	ctr = (function() {
		v = 1.0;
		c = 5 + ((hasCommunion)?1:0);
		for(var i = 0; i++ < c; v += 0.28);
		return v;
	})();

	doc.setFontType('bolditalic');
	doc.setFontSize(12);
	doc.text(2.75, ctr, dl.gV('sermonTitle'), null, null, 'center');
	doc.setFontSize(9);
	doc.setFontType('italic');
	doc.text(2.75, inc(0.15), dl.gV('sermonVerse'), null, null, 'center');

	var disc_1 = '*If you are visiting today, you are our guest and are not expected to give.';
	var disc_2 = 'The offering is for people who consider GBC their home church.';
	doc.setFontSize(8.5);
	doc.text(2.75, 3.95, disc_1, null, null, 'center');
	doc.text(2.75, 4.10, disc_2, null, null, 'center');


	//divider line
	doc.setLineWidth(0.01);
	doc.line(1.2, 4.4, 4.3, 4.4);
}


function gen_Ministries(doc) {

	//divider line
	doc.setLineWidth(0.01);
	doc.line(1.2, 4.8, 4.3, 4.8);

	//title
	doc.setFontSize(17);
	doc.setFontType('italic');
	doc.text(2.75, 5.2, 'WEEKLY MINISTRIES', null, null, 'center');

	var y_counter = 5.6;

	var addMinistry = function(title, time, timeX, desc) {
		doc.setFontSize(11);
		doc.setFontType('bold');
		doc.text(0.3, y_counter, title);

		doc.setFontSize(10);
		doc.setFontType('italic');
		doc.text(5.2, y_counter, time, null, null, 'right');

		doc.setFontType('normal');
		desc = doc.splitTextToSize(desc, 4.9);
		doc.text(0.3, y_counter+0.19, desc);

		y_counter += (desc.length * 0.18) + 0.35;
	}

	addMinistry('Saturday Service', 
		'Saturdays @5pm', 1.8, 
		'Worship - Sermon - Dinner');

	addMinistry('Grace Student Ministries', 
		'Saturdays @7:30pm', 2.5, 
		"Some creative text goes here describing the purpose of this meeting for grade-school students.  Meets at the Side Chapel, contact mattc471776@gmail.com for details.");

	addMinistry('Coffee Hour w/ Pr. Frank', 
		'2nd Saturdays of the month @7:30pm', 2.5, 
		"There's coffee, donuts, and a message by Pr. Frank.  Meets at the Side Chapel, contact asdf@asdf.com for details.");

	addMinistry('Young Adult Bible Study', 
		'Mondays @7:30pm', 2.5,
		"Decompress from school and work while exploring the word of God through scripture.  Meets at the classrooms, contact joechengbc@gmail.com for details.");
}


